import React, { useState } from "react";
import NavBar from "./NavBar";
import Header from "./Header";

import "./Home.css";

const dataNavbarMenu = [
  {
    type: "Stays",
    icon: "fa-bed",
    active: true,
  },
  {
    type: "Flights",
    icon: "fa-plane",
    active: false,
  },
  {
    type: "Car rentals",
    icon: "fa-car",
    active: false,
  },
  {
    type: "Attractions",
    icon: "fa-bed",
    active: false,
  },
  {
    type: "Airport taxis",
    icon: "fa-taxi",
    active: false,
  },
];

const Home = () => {
  return (
    <div className="container">
      <NavBar dataNavbarMenu={dataNavbarMenu} />
      <Header />
    </div>
  );
};

export default Home;
